text382540.addInnerText('<div id=\"text382540\" aria-live=\"polite\" ><a id=\"text382540anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<p lang=\"en\"  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382540Font2\" style=\"position:relative;top:-1px;\" >Security Caveats</span ><span class=\"text382540Font3\" style=\"position:relative;top:-1px;\" > </span ><span class=\"text382540Font2\" style=\"position:relative;top:-1px;\" >are a warning that the information has special requirements in addition to those indicated by the protective marking. Caveats may only be applied to classified information (PROTECTED and above).&nbsp;\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382540Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382540Font2\" style=\"position:relative;top:-1px;\" >There are four different categories of security caveat:</span ><span class=\"text382540Font4\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text382540Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382540CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382540Font2\"  >Codewords including source codewords and compartmented information\n</span ></li >\n<li  class=\"text382540Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382540CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382540Font2\"  >Special Handling used only within particular \'need to know\' compartments\n</span ></li >\n<li  class=\"text382540Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382540CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382540Font2\"  >Accountable Material such as TOP SECRET material and CABINET material, and\n</span ></li >\n<li  class=\"text382540Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382540CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382540Font2\"  >Releasability Indicators such as Eyes Only, RELEASABLE TO (REL), and Australian Government Access Only (AGAO) \n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382540Font3\" style=\"position:relative;top:-1px;\" >&nbsp;</span ><span class=\"text382540Font4\" style=\"position:relative;top:-1px;\" >​\n</span ></p >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');

ht:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382503Font2\" style=\"position:relative;top:-1px;\" >​​​​​​\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382503Font2\" style=\"position:relative;top:-1px;\" >&nbsp;</span ><span class=\"text382503Font4\" style=\"position:relative;top:-1px;\" >&nbsp;​\n</span ></p >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');

text382523.addInnerText('<div id=\"text382523\" aria-live=\"polite\" ><a id=\"text382523anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<p lang=\"en\"  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382523Font1\" style=\"position:relative;top:-1px;\" >A Dissemination Limiting Marker (DLM) is applied to sensitive information that does not warrant a classification. OFFICIAL:Sensitive is the only DLM in use, and is applied where the compromise of information could cause </span ><span class=\"text382523Font2\" style=\"position:relative;top:-1px;\" >limited damage</span ><span class=\"text382523Font1\" style=\"position:relative;top:-1px;\" > to the national interest, Defence or individuals. It used to be known as For Official Use Only (FOUO).\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382523Font1\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382523Font1\" style=\"position:relative;top:-1px;\" >Information Management Markers (IMMs) are an optional way to identify information that is subject to non-security related restrictions on access and use. They can be used in conjunction with classified and OFFICIAL: Sensitive information and include terms such as: Legal Privilege, Legislative Secrecy, and Personal Privacy.&nbsp;\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382523Font1\" style=\"position:relative;top:-1px;\" >&nbsp;</span ><span class=\"text382523Font3\" style=\"position:relative;top:-1px;\" >&nbsp;​\n</span ></p >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
